import { useEffect } from "react";
import axios from 'axios'
import { useNavigate } from "react-router-dom";


export default function Logout(){
    const access_token = localStorage.getItem("access_token")

    const navigate = useNavigate()

    useEffect(() => {
        // window.location.assign(`http://localhost:8090/realms/LibraryAppRealm/protocol/openid-connect/logout`)
        const aaa = async() => {
            await axios.get(`http://localhost:8090/realms/LibraryAppRealm/protocol/openid-connect/logout/logout-confirm?client_id=account`,
            {
                headers: {Authorization: BEARER_HEADER_PREFIX + access_token}
            }
            )
            navigate('/')
            console.log("access_token")
            console.log(localStorage.getItem("access_token"))
        };

        aaa()
        
    }, []);

}
